export function UserFound({userFound , participantsList , setParticipants}){

    async function addUuser() {
        try{
            const updateParticipants = [...participantsList,userFound.id]
            setParticipants(updateParticipants)
        }catch(err){
            console.log(err)
        }
    }


    return <div className='userFound' onClick={() => {addUuser(userFound.id)}}>
        {userFound.name}
    </div>

}
